import React from 'react';
import logo from './logo.svg';
import { Auth0Provider } from "@auth0/auth0-react";
import './App.css';

function App() {
  return (
    <div className="App">
      <Auth0Provider
    domain="dev-6e9pjn91.us.auth0.com"
    clientId="Ac8rN6c8CyAhtRVljxiJ4rQiURiUWe9C"
    redirectUri={window.location.origin}
  >
    <App />
  </Auth0Provider>
    </div>
  );
}

export default App;
